  "translationLines": [
    {
      "lineNumber": 126811,
      "originalJapaneseLine": "「ふふ、すっかり馴染まれたようで良かったですね」",
      "translatedEnglishLine": "\"Hehe, it seems you've completely settled in well, that's good.\""
    },
    {
      "lineNumber": 126812,
      "originalJapaneseLine": "「そーそー、あたしも妖怪だから、",
      "translatedEnglishLine": "\"Yeah, yeah, since I'm a youkai too,"
    },
    {
      "lineNumber": 126813,
      "originalJapaneseLine": "　大丈夫かなーって思ったけど、",
      "translatedEnglishLine": "I was wondering if it would be okay,"
    },
    {
      "lineNumber": 126814,
      "originalJapaneseLine": "　細かいこと気にしない人多くて助かるよー」",
      "translatedEnglishLine": "but there are many people who don't sweat the small stuff, so that helps.\""
    },
    {
      "lineNumber": 126815,
      "originalJapaneseLine": "「ランスの陣営は賑やかでいいねー。",
      "translatedEnglishLine": "\"Lance's camp is lively and nice—"
    },
    {
      "lineNumber": 126816,
      "originalJapaneseLine": "　個性的な奴も多いし」",
      "translatedEnglishLine": "there are also a lot of unique individuals.\""
    },
    {
      "lineNumber": 126817,
      "originalJapaneseLine": "「何よりおはぎも美味しいしー」",
      "translatedEnglishLine": "\"Above all, the ohagi (sweet rice cakes) are delicious too—\""
    },
    {
      "lineNumber": 126818,
      "originalJapaneseLine": "「んー、うまうまー♪」",
      "translatedEnglishLine": "\"Mmm, yummy yummy♪\""
    },
    {
      "lineNumber": 126819,
      "originalJapaneseLine": "折女は幸せそうにおはぎの味を楽しんでいた。",
      "translatedEnglishLine": "Orihime was happily enjoying the taste of the ohagi."
    },
    {
      "lineNumber": 126820,
      "originalJapaneseLine": "「アハハハハハハ！」",
      "translatedEnglishLine": "\"Ahahahahaha!\""
    },
    {
      "lineNumber": 126821,
      "originalJapaneseLine": "「……ふっ！」",
      "translatedEnglishLine": "\"...Hmph!\""
    },
    {
      "lineNumber": 126822,
      "originalJapaneseLine": "折女めがけてベゼルアイの巨大な剣が",
      "translatedEnglishLine": "A gigantic sword of Bezel Eye swung down,"
    },
    {
      "lineNumber": 126823,
      "originalJapaneseLine": "空気を切り裂きながら振り下ろされる。",
      "translatedEnglishLine": "cutting through the air as it was brought down toward Orihime."
    },
    {
      "lineNumber": 126824,
      "originalJapaneseLine": "「はっ！」",
      "translatedEnglishLine": "\"Ha!\""
    },
    {
      "lineNumber": 126825,
      "originalJapaneseLine": "しかし、折女の素早さを捉えきれず、",
      "translatedEnglishLine": "However, failing to catch Orihime's quickness,"
    },
    {
      "lineNumber": 126826,
      "originalJapaneseLine": "地面に叩きつけられる。",
      "translatedEnglishLine": "the sword was knocked down to the ground."
    },
    {
      "lineNumber": 126827,
      "originalJapaneseLine": "中庭で折女とベゼルアイが戦っていた。",
      "translatedEnglishLine": "Orihime and Bezel Eye were fighting in the courtyard."
    },
    {
      "lineNumber": 126828,
      "originalJapaneseLine": "「こ、これが人外同士の戦いか……」",
      "translatedEnglishLine": "\"Th-this is a battle between non-humans...\""
    },
    {
      "lineNumber": 126829,
      "originalJapaneseLine": "「むう、なんたる迫力……」",
      "translatedEnglishLine": "\"Mmm, what an overwhelming force...\""
    },
    {
      "lineNumber": 126830,
      "originalJapaneseLine": "周りにはこの戦いは見逃せないと、",
      "translatedEnglishLine": "Around them, soldiers gathered as they couldn’t miss watching this battle,"
    },
    {
      "lineNumber": 126831,
      "originalJapaneseLine": "兵士達がわらわらと野次馬になっていた。",
      "translatedEnglishLine": "becoming a crowd of onlookers."
    },
    {
      "lineNumber": 126832,
      "originalJapaneseLine": "「あ、あわわわ……",
      "translatedEnglishLine": "\"Ah, awawa...\""
    },
    {
      "lineNumber": 126833,
      "originalJapaneseLine": "　あの、ランス様、なんでこんなことに……」",
      "translatedEnglishLine": "\"Um, Lord Lance, why has it come to this...?\""
    },
    {
      "lineNumber": 126834,
      "originalJapaneseLine": "「俺も今来たところだが、",
      "translatedEnglishLine": "\"I just arrived here too, but"
    },
    {
      "lineNumber": 126835,
      "originalJapaneseLine": "　二人はさっきまで一緒に仲良く",
      "translatedEnglishLine": "apparently the two were just happily"
    },
    {
      "lineNumber": 126836,
      "originalJapaneseLine": "　おはぎを食べていたらしい……」",
      "translatedEnglishLine": "eating ohagi together not so long ago...\""
    },
    {
      "lineNumber": 126837,
      "originalJapaneseLine": "「で、今、最後の一個を",
      "translatedEnglishLine": "\"And now, they are"
    },
    {
      "lineNumber": 126838,
      "originalJapaneseLine": "　取り合っているところだそうだ」",
      "translatedEnglishLine": "apparently fighting over the last one.\""
    },
    {
      "lineNumber": 126839,
      "originalJapaneseLine": "「って、そんなことですか！？",
      "translatedEnglishLine": "\"Is it really just over something like that?!\""
    },
    {
      "lineNumber": 126840,
      "originalJapaneseLine": "「そんなことじゃないよー」",
      "translatedEnglishLine": "\"No, it's not just that—\""
    },
    {
      "lineNumber": 126841,
      "originalJapaneseLine": "「そうそう、最後の一個は",
      "translatedEnglishLine": "\"Yeah yeah, the last one"
    },
    {
      "lineNumber": 126842,
      "originalJapaneseLine": "　おはぎ十個分にも勝る価値があるんだから」",
      "translatedEnglishLine": "has value greater than ten ohagi combined.\""
    },
    {
      "lineNumber": 126843,
      "originalJapaneseLine": "「わ、分かりません……よく分かりません……」",
      "translatedEnglishLine": "\"I-I don’t understand... I really don’t understand...\""
    },
    {
      "lineNumber": 126844,
      "originalJapaneseLine": "「ふっ……！」",
      "translatedEnglishLine": "\"Hmph...!\""
    },
    {
      "lineNumber": 126845,
      "originalJapaneseLine": "豪の剣が叩き潰さん勢いで叩きつけられる。",
      "translatedEnglishLine": "Go’s sword was slammed down with crushing force."
    },
    {
      "lineNumber": 126846,
      "originalJapaneseLine": "「ハハハハ、当たらなければなんてことないねー」",
      "translatedEnglishLine": "\"Hahaha, as long as you don't get hit, it's nothing!\""
    },
    {
      "lineNumber": 126847,
      "originalJapaneseLine": "まるで夏の日の陽炎のように揺らぎ、",
      "translatedEnglishLine": "Flickering like a mirage on a summer day,"
    },
    {
      "lineNumber": 126848,
      "originalJapaneseLine": "折女が巧みに攻撃を避ける。",
      "translatedEnglishLine": "Orihime skillfully avoided the attacks."
    },
    {
      "lineNumber": 126849,
      "originalJapaneseLine": "「くっ……」",
      "translatedEnglishLine": "\"Guh...\""
    },
    {
      "lineNumber": 126850,
      "originalJapaneseLine": "「アハハハハハハ！",
      "translatedEnglishLine": "\"Ahahahahaha!"
    },
    {
      "lineNumber": 126851,
      "originalJapaneseLine": "　楽しいねぇ！　楽しいねぇ！」",
      "translatedEnglishLine": "This is fun! This is fun!\""
    },
    {
      "lineNumber": 126852,
      "originalJapaneseLine": "折女の瞳が鈍く光る。",
      "translatedEnglishLine": "Orihime's eyes glowed dimly."
    },
    {
      "lineNumber": 126853,
      "originalJapaneseLine": "「本当に楽しいよ……」",
      "translatedEnglishLine": "\"It's really fun...\""
    },
    {
      "lineNumber": 126854,
      "originalJapaneseLine": "「こんなに楽しいのは、",
      "translatedEnglishLine": "\"It’s been a long time since I've had this much fun,"
    },
    {
      "lineNumber": 126855,
      "originalJapaneseLine": "　あのとき以来かねぇ！」",
      "translatedEnglishLine": "maybe since that time!\""
    },
    {
      "lineNumber": 126856,
      "originalJapaneseLine": "「むっ……！」",
      "translatedEnglishLine": "\"Mm...!\""
    },
    {
      "lineNumber": 126857,
      "originalJapaneseLine": "幻惑を疑いたくなるような剣の乱舞。",
      "translatedEnglishLine": "A dance of swords so dazzling it makes one suspect illusion."
    },
    {
      "lineNumber": 126858,
      "originalJapaneseLine": "複数の斬撃が同時にベゼルアイに迫る。",
      "translatedEnglishLine": "Multiple slashes came at Bezel Eye simultaneously."
    },
    {
      "lineNumber": 126859,
      "originalJapaneseLine": "「ふんっ！」",
      "translatedEnglishLine": "\"Hmph!\""
    },
    {
      "lineNumber": 126860,
      "originalJapaneseLine": "なんと、ベゼルアイは避けも受けもせず、",
      "translatedEnglishLine": "Surprisingly, Bezel Eye neither dodged nor blocked,"
    },
    {
      "lineNumber": 126861,
      "originalJapaneseLine": "折女に向け真っ直ぐ突き進むことで、",
      "translatedEnglishLine": "instead charged straight toward Orihime,"
    },
    {
      "lineNumber": 126862,
      "originalJapaneseLine": "ダメージを最小限に抑えた。",
      "translatedEnglishLine": "minimizing the damage taken."
    },
    {
      "lineNumber": 126863,
      "originalJapaneseLine": "「はあああっ！」",
      "translatedEnglishLine": "\"Haaaah!\""
    },
    {
      "lineNumber": 126864,
      "originalJapaneseLine": "「アハハハ！　さすがさすがーっ！」",
      "translatedEnglishLine": "\"Ahahaha! As expected, as expected!\""
    },
    {
      "lineNumber": 126865,
      "originalJapaneseLine": "二人が戦っているだけで、",
      "translatedEnglishLine": "Just from the two of them fighting,"
    },
    {
      "lineNumber": 126866,
      "originalJapaneseLine": "辺りでビリビリとした覇気が弾けた。",
      "translatedEnglishLine": "a crackling aura of dominance burst around them."
    },
    {
      "lineNumber": 126867,
      "originalJapaneseLine": "「ひっ……！」",
      "translatedEnglishLine": "\"Eek...!\""
    },
    {
      "lineNumber": 126868,
      "originalJapaneseLine": "「ら、ランス様、これはまずいんじゃ……」",
      "translatedEnglishLine": "\"L-Lord Lance, this isn't good, is it...?\""
    },
    {
      "lineNumber": 126869,
      "originalJapaneseLine": "「二人とも引き際見失ってるな……」",
      "translatedEnglishLine": "\"Both of them have lost sight of when to back down...\""
    },
    {
      "lineNumber": 126870,
      "originalJapaneseLine": "「こらー！　やめんかお前ら！",
      "translatedEnglishLine": "\"Hey! You guys, stop it!\""
    }
  ]
}

